--no development times; Grade 1 Fulton device deployment cost 0
----------------------
--INFO
--p50 This has to be unique! If it is 0, it will overwrite the very first entry! The first handgun uptop with p50=0 --If this Id is non zero, then it absolutely has to follow the previous one, no breaks!
--p51 is the order of dev of item chains, when 0 it is the first item in the dev chain
--p52 is grade, grade has to be 1 to show in respective dev tab
--** combo of p51 and p52 creates the dev chain for an item/weapon - can be customized but if not careful, may break development menu tabs/game in subtle ways
--p53 is dev GMP
--** first unit type requirement is not set in this file, or in any file as far as I can tell
--p56 is the second unit type requirement that is required, can be zero but still u never know. Values range from 1-7, each corresponds to an MB unit, dnt remember exact order
--p55 and p57 are unit lvl requiremenets, these cannot be zero if a unit type is set
--p58, p60 are dev resource types
--p59, p61 are dev resource values
--p62=1, --1 to auto build? YES!
--p65 and p67 are usage resource types
--p66 and p68 are usage resource vales
--p69 --has to be 0 for weapon to show up in dev menu --is used to "hide" all DLC as well as equip that you are not supposed to use from the development menus - like enemy weapons/items/shields as well as balaclavas
----It seems that the enemy and player weapons system are completely different. Enemy weapons from EquipIdTable are copies to Const and Flow files and not the other way around. This is so that you player can have all the equip info for enemy equip. By setting p69=0, these never show up in the dev menus :)
----This is done most likely so that the player equip system loads the info about soldier weapons as well. I am pretty sure this is the case since weapons on FOBs can't be picked up and don't have info associated with them
----Console DLC items with missing textures break sortie screen as normal. Horse tacks can be sort of unlocked - the game will reset D-Horse if you deploy with the DLC tacks but you can at least change to them once in game. DLC outfits are a no go. Setting all p69=0 will add enemy equip to menus. Totally breaks pistol slot on sortie screen. Plus missing textures problem with enemy equip too.
--p71 is dev time
--p74 is online items - changing to 0 does nothing seemingly
--
--Also order of records in these files seems to be strict meaning you can't insert the same number of records at the beginning or in the middle in both the Const and Flow files and expect it to work. The dev pages/chains break. Anything new has to go at the end.
