--REPLACE:
--p54=(.*),p55= | make 1/4
--p66=(.*),p67= | make 1/4
--p68=(.*),p69= | make 1/4
--p71=(.*),p72= | make 0
--OFFLINE ITEMS: p54=(.*),p55  | make 1/4
--ONLINE ITEMS: p52=(7|8|9|10|11|12|13|14|15)(.*)p54=(.*)/4,p55 | make 1/8
--
--Replace regex:
--Step 1 - All
--p54=(.*),p55=(.*),p66=(.*),p67=(.*),p68=(.*),p69=(.*),p71=(.*),p72=
--p54=\1/4,p55=\2,p66=\3/4,p67=\4,p68=\5/4,p69=\6,p71=0,p72=
--
--Step 2 - ONLINE items:
--p52=(7|8|9|10|11|12|13|14|15)(.*)p54=(.*)/4,p55
--p52=\1\2p54=\3/8,p55
--
