local function development_ENABLE_reduceUnitLvlReq(unitLvl)
	if TUPPMSettings.development_ENABLE_reduceUnitLvlReq and unitLvl~=0 then
		return 1
	end
	return unitLvl
end

local function development_ENABLE_onlineGearOffline(flag)
	if TUPPMSettings.development_ENABLE_onlineGearOffline then
		return 0
	end
	return flag
end

